import React, {useState, useEffect} from 'react';

const List = () => {
  const[listItem, setListItem]=  useState([]);
  const API = "http://www.songsterr.com/a/ra/songs/byartists.json?";

  useEffect(()=>{
    window
      .fetch(`${API}artists=Juanes`)
      .then((response) => response.json())
      .then(data=>{
        console.log(data)
        setListItem(data)
      });
  },[])

  return (
    <div>
      {listItem.map((song)=>{
        <article>{song.title}</article>
      })}
    </div>
  );
};

export default List;
